-- Company
create table company
(
  id bigserial not null
  constraint company_pk
  primary key,
  name varchar(128) not null
);

alter table company owner to admin;

create unique index company_id_uindex on company (id);

-- Office
create table office
(
  id bigserial not null
  constraint office_pk
  primary key,
  company_id bigint
  constraint office_company_id_fk
  references company,
  country varchar(128),
  city varchar(128),
  address varchar(256)
);

alter table office owner to admin;

create unique index office_id_uindex on office (id);

-- Employee
create table employee
(
id bigserial not null
constraint employee_pk
primary key,
name varchar(256),
surname varchar(256),
birthday date default CURRENT_DATE,
email varchar(126),
job_title varchar(128),
salary numeric,
start_date date default CURRENT_DATE,
end_date date,
company_id bigint
constraint employee_company_id_fk
references company,
office_id bigint
constraint employee_office_id_fk
references office
);

alter table employee
owner to admin;

create unique index employee_id_uindex
on employee (id);

